        <section class="card">
          <h3>External keyboard + mouse</h3>
          <p><strong>Best for:</strong> longer sessions and better posture.</p>
          <p><strong>Look for:</strong> taller height options and a stable base that wont tip when you adjust the screen.</p>
        </section>
